// HomeComponent.js

// HomeComponent.js

import React, { useState, useEffect } from 'react';
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';
import Modal from 'react-modal';
import 'react-modal/css/styles.css';

const HomeComponent = () => {
  const [selectedDate, setSelectedDate] = useState(new Date());
  const [selectedEmoji, setSelectedEmoji] = useState('');
  const [diaryEntries, setDiaryEntries] = useState([]);
  const [modalIsOpen, setIsOpen] = useState(false);

  // useEffectÏóêÏÑú Í∞ÄÏßú Îç∞Ïù¥ÌÑ∞ Î°úÎìú
  useEffect(() => {
    const fakeData = [
      { date: '2024-01-01', emoji: 'üòÄ', text: 'Happy New Year!' },
      { date: '2024-01-02', emoji: 'üéâ', text: 'Celebrated with friends.' },
      // Ïó¨Í∏∞Ïóê Îçî ÎßéÏùÄ Í∞ÄÏßú Îç∞Ïù¥ÌÑ∞Î•º Ï∂îÍ∞ÄÌï† Ïàò ÏûàÏäµÎãàÎã§.
    ];
    setDiaryEntries(fakeData);
  }, []);

  const handleDayClick = (date) => {
    const clickedDate = date.toISOString().split('T')[0]; // format to 'yyyy-mm-dd'
    const entry = diaryEntries.find(entry => entry.date === clickedDate);
    if (entry) {
      setSelectedEmoji(entry.emoji);
      setIsOpen(true);
    }
  };

  const closeModal = () => {
    setIsOpen(false);
  };

  return (
    <div>
      <Calendar
        onClickDay={handleDayClick}
      />

      <Modal
        isOpen={modalIsOpen}
        onRequestClose={closeModal}
        contentLabel="Diary Entry"
      >
        <h2>Diary Entry</h2>
        <p>Selected Emoji: {selectedEmoji}</p>
        <button onClick={closeModal}>Close</button>
      </Modal>
    </div>
  );
};

export default HomeComponent;


